PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "action_time" datetime NOT NULL, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0));
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "authtoken_token" ("key" varchar(40) NOT NULL PRIMARY KEY, "created" datetime NOT NULL, "user_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "guardian_groupobjectpermission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_pk" varchar(255) NOT NULL, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "guardian_userobjectpermission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_pk" varchar(255) NOT NULL, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "api_groupinfo" ("group_id" varchar(150) NOT NULL PRIMARY KEY REFERENCES "auth_group" ("name") DEFERRABLE INITIALLY DEFERRED, "delete_members_on_group_deletion" bool NOT NULL, "description" text NOT NULL, "expiration" datetime NULL, "max_n_members" integer NULL, "owner_user_id" varchar(150) NOT NULL REFERENCES "auth_user" ("username") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "api_newusers" ("email" varchar(254) NOT NULL PRIMARY KEY, "temp_identifier" text NOT NULL, "token" text NULL, "hostname" text NULL, "created" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "api_prefix" ("prefix" varchar(5) NOT NULL PRIMARY KEY, "certifying_server" text NULL, "certifying_key" text NULL, "created" datetime NULL, "description" text NULL, "expires" datetime NULL, "n_objects" integer NOT NULL, "created_by_id" varchar(150) NOT NULL REFERENCES "auth_user" ("username") DEFERRABLE INITIALLY DEFERRED, "owner_group_id" varchar(150) NOT NULL REFERENCES "auth_group" ("name") DEFERRABLE INITIALLY DEFERRED, "owner_user_id" varchar(150) NOT NULL REFERENCES "auth_user" ("username") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "api_bco" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "contents" text NOT NULL CHECK ((JSON_VALID("contents") OR "contents" IS NULL)), "object_class" text NULL, "object_id" text NOT NULL, "schema" text NOT NULL, "state" text NOT NULL, "last_update" datetime NOT NULL, "owner_group_id" varchar(150) NULL REFERENCES "auth_group" ("name") DEFERRABLE INITIALLY DEFERRED, "owner_user_id" varchar(150) NULL REFERENCES "auth_user" ("username") DEFERRABLE INITIALLY DEFERRED, "prefix_id" varchar(5) NOT NULL REFERENCES "api_prefix" ("prefix") DEFERRABLE INITIALLY DEFERRED);
